package com.tnif.daytwo;

public class NestedIf {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10;
		if(a>5)
		{
			if(a>4)
			{
				System.out.println("NestedIf");
			}
		}
		else
		{
			System.out.println(" Its not NestedIf");	
		}
					

	}

}
